import './App.css';
import { CardList } from "./components/CardList";
import { SearchBar } from './components/SearchBar';

function App(props) {
  return (
    <>
      <SearchBar />
      <div className='video'>
        <iframe width="620" height="345" className='iframe'
          src="https://www.youtube.com/embed/43OVm86-4rU?autoplay=1&mute=1">
        </iframe>
      </div>
      <div className="App">
        <CardList />
      </div>
    </>

  );
}

export default App;
